import React from "react";

function TeamMember(props) {
  return (
    <div className="box">
      <img src={props.info.img} />
      <h3>{props.info.name}</h3>
      <div>{props.info.phone}</div>
      <div>{props.info.email}</div>
    </div>
  );
}

export default TeamMember;
